import React,{Component} from 'react';
import '../style/bootstrap-4.1.3-dist/css/bootstrap.css';
import minion from '../../minion.jpg';

class App extends Component{
    constructor(props){
        super(props);
        this.state = {};
    }

    render(){
        return(
            <div className="row">
                <p className="col-lg-8">Matcha</p>
                <p className="col-lg-4">Bonjour</p>
                <img src={minion} alt="minion"/>
            </div>
        );
    }
}

export default App;
